import React, { Component } from "react";
import PropTypes from "prop-types";

class Quotes extends Component {
  render() {
    return (
      <div>
        <div>
          <button onClick={this.props.getNewQuotes}>{this.props.this}</button>
        </div>
        <p>for</p>
        <div>
          <button onClick={this.props.getNewQuotes}>{this.props.that}</button>
        </div>
      </div>
    );
  }
}

Quotes.propTypes = {
  this: PropTypes.string,
  that: PropTypes.string
};

export default Quotes;
